// Admin.js
import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import HeaderComponent from './Component/HeaderComponent'; // Import HeaderComponent
import FooterComponent from './Component/FooterComponent';
import Home from './Home';
import HeaderAdmin from './Admin/HeaderAdmin';

function AdminComponent() { // Đổi tên component thành AdminComponent
  return (
    <div className="Admin">

      <BrowserRouter>
        <HeaderComponent />
        <Routes>

          <Route path='/admin/*' element={<HeaderAdmin />}></Route>
        </Routes>
        <Home />
        <FooterComponent />
      </BrowserRouter>
    </div>
  );
}

export default AdminComponent;
